tion</h3>\n\n\n	<ul>\n	<li>IT profile with 2 to 3 yrs experience as Solaris System Engineer or as Solaris System Administrator </li>\n		<li>Preferably a Sun Certified System Engineer Level 1 or Level 2</li>\n	</ul>\n\n\n	<p>Required:</p>\n\n\n	<ul>\n	<li>Solaris (v2.6, 7, 8, 9,10) system administration knowledge </li>\n		<li>Knowledge of <span class=\"caps\">SPARC</span> architecture (Sun, Fujitsu Prime Power, â€¦) </li>\n		<li>Knowledge Datacenter environment </li>\n		<li>Knowledge of Solaris Volume Management: Disksuite and Veritas Volume Manager </li>\n		<li>Basic knowledge of Networking (TCP/IP) and Storage (Backup/SAN/NAS)</li>\n	</ul>\n\n\n	<p>Desirable:</p>\n\n\n	<ul>\n	<li>Backup products : Legato Networker ; Veritas NetBackup </li>\n		<li>HA Solutions : Sun Cluster ; Fujitsu PrimeCluster ; Veritas Cluster &#8211; Storage : <span class=\"caps\">EMC</span> storage products </li>\n		<li>Middleware/DB : Oracle, Websphere, Tivoli,â€¦ </li>\n		<li>Linux : Redhat Enterprise Server ; SuSE/Novell ; HA/HP clustering </li>\n		<li>HP-UX system administration knowledge </li>\n		<li>Any knowledge of specific System Software products like Veritas products (Volume manager/backup/clustering), Legato, Websphere or Tivoli products (TSM,TSNM), would certainly be an advantage. However, your knowledge stems from the real world, not just from books or courses. </li>\n		<li>Within this job teaming, capacity/eagerness to learn and flexibility are of the outmost importance. Maintenance windows on productive systems can be outside of normal working hours, so this is not a 9 to 5 job. </li>\n		<li>You look forward to taking responsibility and initiative. <strong>You communicate with your fellow team members in Dutch, English and French</strong>.</li>\n	</ul>','If you enjoy working within a fast paced and expanding environment, leading by example and have experience in a Team Leading role, send us your CV  \"d.depassos@eurojob-consulting.com\":mailto:d.depassos@eurojob-consulting.com !